import { signInWithGooglePopup } from '../../utils/firebase/firebase.utils'

import './sign-in.styles.scss'

const SignIn = () => {

  const logGoogleUser = async () => {
    const respone = await signInWithGooglePopup()
    console.log(respone);

  }

  return(
    <div className='container mx-auto px-2'>
      <h1 className='pb-3 text-center columns-1'>Sign In Page</h1>
      <div className='lg:grid grid-cols-2 grid-rows-6 grid-cols-1'>
        <div className='container bg-black row-span-6'></div>
        <div className='row-start-3 col-start-2 text-center'>
          <button type="button" className='login-with-google-btn whitespace-nowrap ' onClick={logGoogleUser}>Sign in with Google</button>
        </div>
      </div>
    </div>    
  )
};

export default SignIn;
